import React from "react";
import Link from "next/link";

const App = () => {
  return (
    <div>
      <Link href="/home">
        <a>Home</a>
      </Link>
      <Link href="/page">
        <a>Page</a>
      </Link>
    </div>
  );
};

export default App;
